import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import Home from '../home/index.js';
import Listings from '../rentals/listings/';
import UserListings from '../rentals/listings';
import Faq from '../info/faq/';
import Tnc from '../info/tnc';
import './navstyle.css';

export default class Nagivator extends Component {
    render() {
        return (
            <Router>
                <nav class="navbar navbar-expand-lg navbar-dark info-color">
                    <a class="navbar-brand" >Carlet</a>
                    <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span class="navbar-toggler-icon"></span>
                    </button>
                    <div class="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul class="navbar-nav mr-auto">
                            <li class="nav-item active">
                                <a class="nav-link waves-effect waves-light" ><Link to="/">Home</Link> <span class="sr-only">(current)</span></a>
                            </li>
                            <li class="nav-item dropdown">
                                <a class="nav-link dropdown-toggle waves-effect waves-light" id="navbarDropdownMenuLink" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">Rentals</a>
                                <div class="dropdown-menu dropdown-info" aria-labelledby="navbarDropdownMenuLink">
                                    <a class="dropdown-item waves-effect waves-light" ><Link to="/rentals/listings">listings</Link></a>
                                    <a class="dropdown-item waves-effect waves-light" ><Link to="/rentals/userListings">Your Listings</Link></a>

                                </div>
                            </li>
                            <li class="nav-item dropdown">
                                <a class="nav-link dropdown-toggle waves-effect waves-light" id="navbarDropdownMenuLink" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">Information</a>
                                <div class="dropdown-menu dropdown-info" aria-labelledby="navbarDropdownMenuLink">
                                    <a class="dropdown-item waves-effect waves-light" ><div><Link to="/info/faq">Frequently asked Questions</Link></div></a>
                                    <a class="dropdown-item waves-effect waves-light" ><Link to="/info/tnc">Terms And Conditions</Link></a>

                                </div>
                            </li>
                        </ul>

                    </div>
                </nav>
                <div>
                    <Route exact path="/" Component={Home} />
                    <Route path="rentals/listings" component={Listings} />
                    <Route path="rentals/userListings" component={UserListings} />
                    <Route path="info/faq" component={Faq} />
                    <Route path="info/tnc" component={Tnc} />
                </div>
            </Router >
        );
    }
}
